Mongodb query, flatten objects with array<p>A document:</p>

<pre><code>{
   objectId: 35,
   properties: [
     {
       pset: 'A1',
       property: 'Fire',
       value: '60'
     },
     {
       pset: 'B1',
       property: 'Fire',
       value: '70'
     }  
   ]
}
</code></pre>

<p>Input to query: </p>

<pre><code>{ 
   psetsWithProperties: [{ pset: 'A1', property: 'Fire'}, { pset: 'abc', property: 'fff'}]
}
</code></pre>

<p>The combination of pset and property is always uniq. So there can not be two 'A1' and 'Fire' in the properties collection.</p>

<p>Expected output:</p>

<pre><code>[{
  objectId: 35,
  properties: {
    'A1/Fire': '60'
  }
}]
</code></pre>

<p>So the second item (B1, Fire) is not included since it's not in the input. </p>

<p>If there is no match at all, the properties object is empty:</p>

<pre><code>[{
  objectId: 35,
  properties: {}
}]
</code></pre>

<p>The MongoDB aggregation framework should be used here.</p>

<p>Something with <code>$in, $group, $unwind</code> I think.</p>

<p>Don't really know where to start.</p>

<p>Does not have to be exactly as in my examples.</p>

<p>Any ideas?</p>

