 { "_id" : 2, "car" : { "engineSize" : 1.3 } }

 { "_id" : 5, "car" : { "engineSize" : 1.4 } } 

 { "_id" : 3, "car" : { "engineSize" : 1 } }
</code></pre>

<p>The command I am using to check for the average is:</p>

<pre><code>db.project.aggregate([{$group : {_id: null, Average: {$avg: "$engineSize"}}}])
</code></pre>

